❗️Під час евакуації до укриття через обстріли можлива ситуація, коли маленька дитина губиться у великому натовпі людей. 

Що робити, щоб дитина не загубилася:

⭕️ до кишені одягу покладіть клаптик паперу (також можна наклеїти наліпку на одяг) з вашими контактними даними (ПІБ дитини, ПІБ батьків, номер телефону батьків, адреса проживання), також спробуйте вивчити з дитиною цю інформацію;

⭕️ одягніть дитину у яскравий одяг, щоб її можна було відразу побачити у великому натовпі людей;

⭕️ якщо у дитини є наручний годинник з GPS навігацією та SOS-кнопкою, обов’язково надягніть його перед евакуацією та навчіть малюка ним користуватися;

⭕️ покажіть дитині людей, до яких вона може звернутися за допомогою, якщо загубилася, наприклад, поліцейських.

Також варто вже зараз обговорити з дитиною, як вона буде діяти, якщо загубиться.

